sys_variable_value.value:
(function execute(inputs, outputs) {
    var stream = sn_fd.FlowAPI.executeDataStreamAction('sn_gogle_vpn_spoke.fetch_firewalls', {
        "project_id": inputs.projectid
    });
    var obj = []
    while (stream.hasNext()) {
        obj.push(stream.next())
    }
    var firewalls = [];
    obj.forEach(function(firewallObj) {
        firewalls.push({
            "label": firewallObj.name.toUpperCase(),
            "name": firewallObj.name
        });
    })
    outputs.firewalls = {
        data: firewalls
    }
})(inputs, outputs);

